import React from "react";
import web from "../src/images/virus.png";
import { NavLink } from "react-router-dom";
import Commom from "./Commom";

const Home = () => {
  return (
    <>
      <Commom
        name="Covid 19"
        imgsrc={web}
        visit="/service"
        btname="Get Started"
        className="brand-name"
      />
    </>
  );
};

export default Home;
